import ProductList from './components/ProductList';
import Header from './components/Header';
import './App.css';
import CustomItemContext from './context/ItemContext';


const App = () => {
	return (
		<CustomItemContext>
			<Header />
			<ProductList />
		</CustomItemContext>
	);
};

export default App;
